//SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

//Here we will be using events in order
//to keep track of function calls

contract BigCat{

    event Name(string name);

    function run() public virtual{

        emit Name("run returns BigCat");
    }

    function run2() public virtual{

        emit Name("run2 also returns BigCat");
    }
}

contract Lion is BigCat{

    function run() public virtual override{

        emit Name("run returns Lion");
        //To access parent function
        BigCat.run();
    }
    function run2() public virtual override{

        emit Name("run2 also returns Lion");
        //Another way to access parent function
        super.run2();
    }
}

contract Tiger is BigCat{

    function run() public virtual override{

        emit Name("run returns Tiger");
        //To access parent function
        BigCat.run();
    }
    function run2() public virtual override{

        emit Name("run2 also returns Tiger");
        //Another way to access parent function
        super.run2();
    }
}

contract Liger is Lion, Tiger{
    //Notice that BigCat is called only once
    function run() public override(Lion, Tiger){

        super.run();
    }

    function run2() public override(Lion, Tiger){

        super.run2();
    }
}

